// SPDX-License-IDentifier: MIT OR Apache-2.0
pragma solidity ^0.8.4;
import "@openzeppelin/contracts/utils/Strings.sol";


interface ERC20Standard {
    function totalSupply() external view returns (uint256);
    function balanceOf(address _owner) external view returns (uint256 balance);
    function transfer(address _to, uint256 value) external returns (bool success);
    function transferFrom(address _from, address _to, uint256 value) external returns (bool success);
    function approve(address _spender, uint256 value) external returns (bool success);
    function allowance(address _owner, address _spender) external view returns (uint256 remaining);
    event Transfer(address indexed _from, address indexed _to, uint256 value);
    event Approval(address indexed _owner, address indexed _spender, uint256 _value);
}

contract BankProtocol {
    string public name = "Bank Protocol";

    address public payoutToken;

    uint dailyRate = 100027;

    address[] public stakers;
    mapping(address => uint) public stakingBalance;
    mapping(address => bool) public hasStaked;
    mapping(address => bool) public isStaking;
    mapping(address => uint) public rewardBalance;
    mapping(address => uint) public lastCalc;

    constructor(address BankToken) {
        payoutToken = BankToken;
    }

    function contBalance() public view returns (uint) {
        return address(this).balance;
    }

    function payoutAddr() public view returns (address) {
        return payoutToken;
    }

    function getDailyRate() public view returns (uint) {
        return dailyRate;
    }
    function getTimestampTest() public view returns (uint) {
        return block.timestamp;
    }

    function calculateReward(address sender) internal {
        uint start = lastCalc[sender];
        uint end = block.timestamp;
        uint difference = end - start;

        uint accumulated = difference * dailyRate * stakingBalance[sender];
        rewardBalance[sender] = rewardBalance[sender] + accumulated;
        lastCalc[sender] = block.timestamp;
    }

    function checkCurrentReward() public view returns(string memory) {
        string memory output="";

        uint start = lastCalc[msg.sender];
        uint end = block.timestamp;
        uint difference = end - start;

        uint accumulated = difference * dailyRate * stakingBalance[msg.sender];

        output = string(abi.encodePacked(Strings.toString(difference)," * ",Strings.toString(dailyRate)," * ",Strings.toString(stakingBalance[msg.sender])));

        return output;
    }


    function stakeTokens() external payable {
        uint _amount = msg.value;
        stakingBalance[msg.sender] = stakingBalance[msg.sender] + _amount;

        if(!hasStaked[msg.sender]) {
            stakers.push(msg.sender);
            rewardBalance[msg.sender] = 0;
            lastCalc[msg.sender] = block.timestamp;
        } else {
            calculateReward(msg.sender);
        }

        hasStaked[msg.sender] = true;
        isStaking[msg.sender] = true;
    }

    function unstakeTokens(uint _amount) public {
        uint balance = stakingBalance[msg.sender];

        require(balance >= _amount, "The amount to unstake must be less than or equal to the current staked balance with this address");
        payable(address(msg.sender)).transfer(_amount);

        stakingBalance[msg.sender] = stakingBalance[msg.sender] - _amount;
        calculateReward(msg.sender);
        if (stakingBalance[msg.sender] == 0) {
            isStaking[msg.sender] = false;
        }
    }

    function issueInterestToken() public {
        for (uint i=0; i<stakers.length; i++) {
            address recipient = stakers[i];
            uint balance = stakingBalance[recipient];

            if (balance > 0) {
                ERC20Standard(payoutToken).transfer(recipient, balance);
            }
        }
    }
}

